const https = require('https');

export const informationCountry=https.get('https://restcountries.com/v3.1/all',res=>{

    let information='';
    res.on('data',data =>{
        information += data;
    })

    res.on('end',()=> {return information;});
}).on('error',error => console.error(error.message));

console.log(informationCountry);
